import {atom} from 'recoil';

function App() {

  const cartAtom=atom({
      key:'cart',
      default:{}
  })

  return (
    <div className='App'>
    <Navbar />
    <div className="App">
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/products/:id" element={<Product />}/>
      </Routes>  
    </div>
    </div>
  );
}

export default App;
